import React, { useState } from "react";
import { Link } from "react-router-dom";
import { FaBars, FaTimes, FaMoon, FaSun, FaUser, FaGlobe, FaSearch } from "react-icons/fa";

const Navbar = () => {
  const [darkMode, setDarkMode] = useState(localStorage.getItem("darkMode") === "true");
  const [menuOpen, setMenuOpen] = useState(false);
  const [horoscopeDropdown, setHoroscopeDropdown] = useState(false);

  const handleDarkMode = () => {
    setDarkMode(!darkMode);
    document.documentElement.classList.toggle("dark", !darkMode);
    localStorage.setItem("darkMode", !darkMode);
  };

  return (
    <nav className="fixed top-0 left-0 w-full z-50 backdrop-blur-xl bg-white/20 dark:bg-gray-900/20 shadow-xl border-b border-white/30 dark:border-gray-800/50 transition-all duration-500">
      <div className="max-w-7xl mx-auto px-6 flex justify-between items-center py-4">

        {/* Logo */}
        <Link to="/" className="text-4xl font-bold text-yellow-400 transition transform hover:scale-110">
          🔮 AstroSphere
        </Link>

        {/* Search Bar */}
        <div className="hidden md:flex items-center bg-gray-200 dark:bg-gray-800 px-4 py-2 rounded-full shadow-lg">
          <FaSearch className="text-gray-500 dark:text-gray-400" />
          <input
            type="text"
            placeholder="Search horoscopes..."
            className="bg-transparent outline-none ml-2 text-gray-700 dark:text-white"
          />
        </div>

        {/* Desktop Menu */}
        <ul className="hidden md:flex space-x-6 text-gray-700 dark:text-white font-medium">
          <li><Link to="/" className="hover:text-yellow-400 transition duration-300">🔮 Free Kundli</Link></li>
          <li><Link to="/kundli-matching" className="hover:text-yellow-400 transition duration-300">💞 Kundli Matching</Link></li>

          {/* Horoscope Dropdown */}
          <li className="relative">
            <button onClick={() => setHoroscopeDropdown(!horoscopeDropdown)} className="hover:text-yellow-400 transition duration-300 flex items-center">
              <FaGlobe className="mr-2" /> Horoscopes ▼
            </button>
            {horoscopeDropdown && (
              <ul className="absolute left-0 mt-2 bg-white/80 dark:bg-gray-800/50 shadow-lg rounded-lg p-2 w-48 backdrop-blur-md border border-white/40 dark:border-gray-700 transition-all transform scale-95 hover:scale-100">
                <li><Link to="/horoscope" className="block px-4 py-2 hover:bg-gray-200 dark:hover:bg-gray-700 rounded-md">Daily Horoscope</Link></li>
                <li><Link to="/horoscope?weekly" className="block px-4 py-2 hover:bg-gray-200 dark:hover:bg-gray-700 rounded-md">Weekly Horoscope</Link></li>
              </ul>
            )}
          </li>

          <li><Link to="/chat-astrologer" className="hover:text-yellow-400 transition duration-300">💬 Chat with Astrologer</Link></li>
          <li><Link to="/talk-astrologer" className="hover:text-yellow-400 transition duration-300">📞 Talk to Astrologer</Link></li>
          <li><Link to="/blog" className="hover:text-yellow-400 transition duration-300">📰 Blog</Link></li>
        </ul>

        {/* Dark Mode & Login */}
        <div className="flex items-center space-x-4">
          <button onClick={handleDarkMode} className="text-gray-700 dark:text-white text-lg transition-all duration-300 hover:scale-110">
            {darkMode ? <FaSun className="text-yellow-400" /> : <FaMoon className="text-indigo-400" />}
          </button>
          <button className="px-4 py-2 bg-gradient-to-r from-yellow-400 to-yellow-600 text-black rounded-full hover:from-yellow-500 hover:to-yellow-700 transition duration-300 flex items-center shadow-lg">
            <FaUser className="mr-2" /> Login
          </button>
        </div>

        {/* Mobile Menu Button */}
        <button className="md:hidden text-gray-700 dark:text-white text-2xl transition duration-300" onClick={() => setMenuOpen(!menuOpen)}>
          {menuOpen ? <FaTimes /> : <FaBars />}
        </button>
      </div>

      {/* Mobile Menu */}
      {menuOpen && (
        <div className="md:hidden fixed top-0 left-0 w-2/3 h-full bg-white dark:bg-gray-900 shadow-lg z-50 transform transition-all duration-500">
          <button className="absolute top-4 right-4 text-gray-700 dark:text-white text-3xl" onClick={() => setMenuOpen(false)}>
            <FaTimes />
          </button>
          <ul className="text-center mt-20 space-y-6 text-gray-700 dark:text-white">
            <li><Link to="/" className="block py-2 hover:text-yellow-400 text-lg">🔮 Free Kundli</Link></li>
            <li><Link to="/kundli-matching" className="block py-2 hover:text-yellow-400 text-lg">💞 Kundli Matching</Link></li>
            <li><Link to="/horoscope" className="block py-2 hover:text-yellow-400 text-lg">🌙 Daily Horoscope</Link></li>
            <li><Link to="/horoscope?weekly" className="block py-2 hover:text-yellow-400 text-lg">📅 Weekly Horoscope</Link></li>
            <li><Link to="/chat-astrologer" className="block py-2 hover:text-yellow-400 text-lg">💬 Chat with Astrologer</Link></li>
            <li><Link to="/talk-astrologer" className="block py-2 hover:text-yellow-400 text-lg">📞 Talk to Astrologer</Link></li>
            <li><Link to="/blog" className="block py-2 hover:text-yellow-400 text-lg">📰 Blog</Link></li>
          </ul>
        </div>
      )}
    </nav>
  );
};

export default Navbar;
